import React, {Component} from 'react';
import {Routes, Route, Redirect} from "react-router-dom"
import Main from "../pages/Main";
import {authRoutes} from "../routes";



const AppRouter = () => {
    return (
       <Routes>
           <Route path='/' element = { <Main/> }/>
       </Routes>
    );
};

export default AppRouter;
